    false,nt"url": null,nt"notes": "This annual narrative report for Mingo
    National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
    year. The report begins with an introduction to the Refuge, climate and habitat
    conditions, land acquisition, and system status. Refuge construction, maintenance,
    and wildfires are also described. Habitat management is covered; croplands, grasslands,
    wetlands, forestlands, and wilderness and special areas are discussed. The wildlife
    section of the report discusses endangered and threatened species, migratory birds,
    mammals, and big game animals. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreational uses, and law enforcement.
    Field investigations, cooperative programs, items of interest, and safety are discussed.
    Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
